  `room_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '表主键',
  `room_number` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '房间号',
  `room_type` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '房间类型,0:留置审查室,1:居住审查室,2:居审一体室,3:一般谈话室,4:留置审查楼正门,5:安全监控室,6:案件指挥室,7:谈话指挥室',
  `room_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '房间名',
  `room_param` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '房间参数,可用于记录位置',
  `room_floor` int NULL DEFAULT NULL COMMENT '房间楼层',
  `version` int NULL DEFAULT 0 COMMENT '版本号,保证串行修改',
  `is_delete` int NULL DEFAULT 0 COMMENT '是否删除:0表示未删除,1表示已删除',
  `creator_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '房间定义创建者id',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `note` varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注',
  `can_auth` int NULL DEFAULT 0 COMMENT '是否可授权,0;否,1可以',
  `use_status` int NULL DEFAULT 0 COMMENT '房间使用状态,0为可用,1为不可用',
  `source` int NOT NULL DEFAULT 0 COMMENT '房间来源,0为系统内新增,1为海康同步',
  INDEX `room_id`(`room_id` ASC) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '房间定义表' ROW_FORMAT = DYNAMIC;

