-- Table structure for tbl_room_allocation
-- ----------------------------
DROP TABLE IF EXISTS `tbl_room_allocation`;
CREATE TABLE `tbl_room_allocation`  (
  `room_allocation_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '房间分配表id',
  `room_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '房间id',
  `allocation_purpose` int NULL DEFAULT NULL COMMENT '分配用途(0谈话,1审讯,2留置,3谈话指挥)\r\n第四版房间预约新加：\r\n4-测谎；5-放风；6-辨认；7-其它',
  `purpose_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '对应对象id(如谈话预约表id,留置表id),配置分配用途进行使用',
  `allocation_start_time` datetime NULL DEFAULT NULL COMMENT '分配开始时间',
  `allocation_end_time` datetime NULL DEFAULT NULL COMMENT '分配结束时间',
  `version` int NULL DEFAULT 0 COMMENT '版本id',
  `creator_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '登记人',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '修改时间',
  `is_delete` int NULL DEFAULT 0 COMMENT '是否删除',
  `allocation_status` int NULL DEFAULT 0 COMMENT '分配状态:0:分配有效中,1:分配已过期,2:分配失效\r\n-1：新增待审批（V4版本新添加）',
  `room_type` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '房间类型，V4版本新增，因为预约时可能存在只提交房间类型，没有房间ID的情况',
  `expect_start_time` datetime NULL DEFAULT NULL COMMENT '预计开始时间'
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '房间分配表' ROW_FORMAT = DYNAMIC;

